import React from "react";
import styled from "styled-components";
import { saturate } from "polished";
import PhoneContact from "./Phone";
import Email from "./Email";
import Address from "./Address";
import SocialIcon from "./SocaiIcon";

const ContactMedium = () => {
  return (
    <Wrapper>
      <PhoneContact />
      <Email />
      <Address />
      <Container>
        <SocialIcon />
        <BigCircle>
          <svg viewBox="0 0 140 140" preserveAspectRatio="xMinYMin meet">
            <g>
              <circle
                id="circle"
                fill="#F44C57"
                fillOpacity="1.0"
                r="70%"
                cx="70%"
                cy="70%"
                class="circle-back"
              />
            </g>
          </svg>
        </BigCircle>
      </Container>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  /* margin: 10px 0px 10px 0px; */
  /* margin: 0 auto; */
  /* padding: 20px 40px 10px 40px; */
  overflow: hidden;
`;

const Container = styled.div`
  width: 100%;
  /* width: 30vw; */
  /* padding: 8px; */
  display: flex;
  flex-direction: row;
  /* margin-left: calc(-10vw + 10%); */
`;

const BigCircle = styled.div`
  float: right;
  height: 300px;
  width: 300px;
  shape-outside: circle();
  /* clip-path: circle(60% at 90%); */
  clip-path: url(#circle);
  background: ${saturate(0.2, "#F44C57")};
  /* & svg {
    height: 80px;
    border: 1px solid red;
  }
  & circle {
    fill: none;
  }
  & .circle-back {
    stroke: #eee;
    stroke-width: 5px;
  } */
`;

export default ContactMedium;
